CREATE TABLE IF NOT EXISTS "UsuariosSena_usuariossena_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "usuariossena_id" varchar(25) NOT NULL REFERENCES "UsuariosSena_usuariossena" ("numeroIdentificacion") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
