CREATE TABLE IF NOT EXISTS "UsuariosSena_inventariodevolutivo" ("fecha_Registro" date NOT NULL, "observacion" text NOT NULL, "serial" varchar(25) NOT NULL PRIMARY KEY, "factura" varchar(100) NULL, "producto_id" bigint NOT NULL REFERENCES "UsuariosSena_productosinventariodevolutivo" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" varchar(25) NOT NULL REFERENCES "UsuariosSena_usuariossena" ("numeroIdentificacion") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
